    firstName: { type: String },
    lastName: { type: String },
    age: { type: Number, maxlength: 3 },
    profilePhoto: { type: String },
    status: { type: String },
  },
  {
    timestamps: true,
  }
);

export default mongoose.model("User", UserSchema);

